(1, 'f899139df5e1059396431415e770c6dd', '<div><div><b></b></div><span style=\"font-size:12px;\"><b>Read the following passage carefully and answer the questions that follow.</b><br>\nThe second half of the match began, and it was soon clear that Ranchers were going to be a hard nut to crack. They were determined to hold on to their one goal lead. Though they did not make the mistake of concentrating on defence, their forwards attacked at the smallest opportunity. But the strength of the Rangers players kept them in the neighbourhood of their own goal.<br>\nThe game continued until a minute to the end. Then everyone gasped with surprised. A Ranchers defender, attacked by three Rangers forwarders, cleared the ball weakly twenty yards up their field, where it was received by the Rangers mid-fielder who for the moment was in a world of his own. He trapped the ball, glanced at the goal post thirty yards away, and seeing one clears penetrable yard of pace, let out a traffic right footer. The aim was perfect. The Ranchers goal-keeper sprang to meet the danger, and as he did so, one of his so doing spoilt the view of the keeper who saw the ball pass his arms into the net.<br>\nA crash of human thunder rented the air, arms umbrellas, hat caps and Newspapers flew up all round the ground, and the shouting grew louder and louder. The Rangers mid-fielder raced back to his own end of the field, partly carried by half a dozen of his team mates. A moment later, the whistle blew for the re-start, and then immediately for time. The score being level, an extra lour had to be played to decide the winning team, and the first period of this started at once. This ended with no charge and the sides crossed over. The game had been played with all fairness, but now minutes to go, the referee to the dismay of forty thousand spectators awarded a penalty kick against Rangers for a foul within the eighteen-yard box. Taking no notice of protest, he pointed to the penalty spot from which a Ranchers player was to be allowed a shot with nothing between him, and net but the Rangers goal-keeper.<br>\nThe ball was placed on the spot, with all Rangers players being sent out of the penalty area except the goal-keeper. Taking a short run, the Ranchers player sent the ball rising with amazing speed towards the top corner of the net. The goal-keeper, cleverly guessing its direction, made an upward dive with outstretched hands towards its flight to deflect it. As rose above the cross-bar the crowd let it self go. Ranchers took their corner kick; a Ranchers defender headed it out of danger, the whistle went and the game was over.<br>\nThe ball was placed on the spot, with all Rangers players being sent out of the penalty area except the goal-keeper. Taking a short run, the Ranchers player sent the ball rising with amazing speed towards the top corner of the net. The goal-keeper, cleverly guessing its direction, made an upward dive with outstretched hands towards its flight to deflect it. As rose above the cross-bar the crowd let it self go. Ranchers took their corner kick; a Ranchers defender headed it out of danger, the whistle went and the game was over.<span style=\"font-size:12px;\"><br>\nThe ball was placed on the spot, with all Rangers players being sent out of the penalty area except the goal-keeper. Taking a short run, the Ranchers player sent the ball rising with amazing speed towards the top corner of the net. The goal-keeper, cleverly guessing its direction, made an upward dive with outstretched hands towards its flight to deflect it. As rose above the cross-bar the crowd let it self go. Ranchers took their corner kick; a Ranchers defender headed it out of danger, the whistle went and the game was over.</span></span></div><div><span style=\"font-size:12px;\"><span style=\"font-size:12px;\"><br></span></span></div><div><span style=\"font-size:12px;\"><span style=\"font-size:12px;\"><br></span></span></div><div><span style=\"font-size:12px;\"><span style=\"font-size:12px;\"><b>Questions<br></b></span></span><div><font style=\"font-size: 12pt;\">From the passage, the game played was ___________</font></div></div>', 'American football', 'Volleyball', 'Hockey', 'Football', 'Cricket', 'D', 3, '7d5322924a4ba382d83e22', '2023-06-05'),
